import styled from "styled-components";

export const BackdropContainer = styled.div`
  position: fixed;
  right: 0;
  top: 0;
  height: 100%;
  width:100%;
  background-color: rgba(0, 0, 0, 0.3);
  z-index: 100;
  top: 0;
`;
